import { FETCH_ALL, CREATE, UPDATE, DELETE } from '../constants/actionTypes'
import * as api from '../api'

export const getEmployees = () => async (dispatch) =>{
    try {
        const { data } = await api.fetchEmployees()

        dispatch({ type: FETCH_ALL, payload: data})
    } catch(error) {
        console.log(error)
    }
}
